{% extends "base.html" %}
<title>{% block title%}Login{%endblock%}</title>

{% block content %}

<form method="POST">
    <h1 align="center" style="color:white; font-size: 145px; font-family: monospace, 'Courier New';">Log In</h1>
    <div style="position:relative; top: 50px; left: 250px; text-emphasis-color: white;">
        <div class="form-group">
            <label for="email" style="color:white; font-size:20px;">Email Address</label>
            <input type="email" class="form-control" id="email" name="email" placeholder="Enter email" style="height: 55px; width: 600px;"/>
        </div>
        <div class="form-group">
            <label for="password" style="color:white; font-size:20px;">Password</label>
            <input type="password" class="form-control" id="password" name="password" placeholder="Enter password" style="height: 55px; width: 600px;"/>
        </div>
        <br/>
        <button type="submit" class="btn btn-primary">Login</button>
    </div> 
</form>
